import React, { useEffect, useState, useContext } from 'react'
import { userContext } from '../../App'

const Home = () => {
    return (
        <div >
            <h1>HOME</h1>
            <Box num="2" text="hi"/>
        </div>
    )
}

function Box(props) {
    const number = props.number;
    const text = props.text;
    return (
        <>
            <p>{number}</p>
            <p>{text}</p>
        </>
    )
}

export default Home
